package main

import (
   "encoding/json"
   "fmt"
   "io"
   "net/http"
   "net/url"
)

func main() {
   var req http.Request
   req.Header = http.Header{}
   req.Header.Add("Authorization", "Bearer " + bearer)
   req.URL = &url.URL{}
   req.URL.Host = "disney.api.edge.bamgrid.com"
   req.URL.Path = "/explore/v1.12/season/f1b38ee5-310d-4be7-b8b3-6998d29d8e85"
   req.URL.Scheme = "https"
   resp, err := http.DefaultClient.Do(&req)
   if err != nil {
      panic(err)
   }
   defer resp.Body.Close()
   data, err := io.ReadAll(resp.Body)
   if err != nil {
      panic(err)
   }
   var result struct {
      Data struct {
         Season struct {
            Items []struct {
               Actions []struct {
                  InternalTitle string
               }
            }
         }
      }
   }
   err = json.Unmarshal(data, &result)
   if err != nil {
      panic(err)
   }
   fmt.Println("len(data)", len(data))
   for _, item := range result.Data.Season.Items {
      fmt.Printf("%+v\n", item.Actions[0])
   }
}

